function PopupWithForm(props) {
    onClose={closeAllPopups}
    return (
        <div className={props.isOpen ? `popup popup__${props.name} popup_is-opened` : `popup popup__${props.name}`}>
            <div className={`popup__container popup__container-${props.container}`}>
                <form className={`popup__form popup__form-${props.name}`} name="information" noValidate >
                    <button className={`popup__close`} type="button"
                            onClick={onClose=closeAllPopups}>
                    </button>
                    <h2 className={`popup__title poput__title-${props.title}`}>Редактировать профиль</h2>
                    {props.children}
                </form>
            </div>
        </div>
    )
}
export default PopupWithForm;
